<br><br>
<br>【商品説明】
<br>
既出のKings Heartの改訂版。<br>前面の半身の虎と背中の傷痕が渋すぎる！
<br>
<br>
★体格や、普段お使いになられているTシャツにもよりますが、日本一般的サイズより0.5～1サイズ程度ゆったりしていると感じられるお客様もおられますので、サイズ表をご確認の上お買い求め下さい。 
<br>
→サイズ別モデル着用写真はコチラ。<br>
<br>
【！ご注文前に！】<br>
★裏返しで洗濯ネットに入れて洗濯を推奨。<br>
★写真と実物は色差が発生する事があります。 <br>
★受注生産品の為、配送に最大半月程度（通常4日）掛かる事があります。<br>
★プリント可能範囲は最大で横38cm縦70cmです。<br>
大サイズ（XXLなど）の場合、余白部分が多少大きくなります。<br>
<br>
